import Button from 'react-bootstrap/Button';
import Container from 'react-bootstrap/Container';
import Form from 'react-bootstrap/Form';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';

function NavScrollExample() {
  return (
    <Navbar expand="lg" className="bg-body-tertiary" bg="dark" data-bs-theme="dark">
      <Container fluid>
        <Navbar.Brand href="#">MYStore</Navbar.Brand>
        <Navbar.Toggle aria-controls="navbarScroll" />
        <Navbar.Collapse id="navbarScroll">
          <Nav
            className="me-auto my-2 my-lg-0"
            style={{ maxHeight: '100px' }}
            navbarScroll
          >
            link
            <Nav.Link id="dk" href="#action1">Home</Nav.Link>
            <Nav.Link id="dk" href="#action2">About</Nav.Link>
            <NavDropdown  title="Topics" id="navbarScrollingDropdown">
              <NavDropdown.Item href="#action3">TECHNOLOGY</NavDropdown.Item>
              <NavDropdown.Item href="#action4">WEB DEVLOPMENT</NavDropdown.Item>
              <NavDropdown.Divider />
              <NavDropdown.Item href="#action5"> SUPPORT</NavDropdown.Item>
              <NavDropdown.Item href="#action6"> WRITE FOR US</NavDropdown.Item>
            </NavDropdown>
            <Nav.Link id="dk" href="#action2">Contact Us</Nav.Link>
          </Nav>
          <Form className="d-flex">
            <Form.Control
              type="search"
              placeholder="Search"
              className="me-2"
              aria-label="Search"
            />
            <Button variant="outline-success">Search</Button>
            &nbsp;
            <Button variant="danger">LOGIN</Button>
            &nbsp;

            <Button variant="danger">SIGNUP</Button>
          </Form>
        </Navbar.Collapse>
      </Container>
    </Navbar>
    
  );
}

export default NavScrollExample;
